        );

    $("#problemsolving").hover
        (function() {
        $("#problemsolvingimage").addClass('hover');}, 
        function() {
        $("#problemsolvingimage").removeClass('hover');}
        );

    $("#cafa").hover
        (function(){
        $("#cover").show();}
         );

   // $(window).resize(resize);
       // resize();
